CREATE DEFINER=`brett`@`%` PROCEDURE `createNextObjectIndex`(
    ownerId BIGINT,
    parentValueId BIGINT
)
BEGIN
   SET  @ownerId = ownerId,
             @parentValueId = parentValueId,
             @valueId = null;
   
   SELECT
       MAX(v.objectIndex) + 1
   INTO
       @objectIndex
   FROM
       Value as v
   WHERE
           v.parentValueId = @parentValueId
   FOR UPDATE;
   
   IF @objectIndex IS NULL THEN
       SET @objectIndex = 0;
   END IF;
   
   INSERT
   INTO
       Value(
           ownerId,
           parentValueId,
           locked,
           type,
           objectKey,
           objectIndex,
           isNull
       )
       VALUES(
           @ownerId,
           @parentValueId,
           1, #locked
           'null', #type
           NULL, #objectKey,
           @objectIndex,
           1 # isNull
        );
       
   SET @valueId = LAST_INSERT_ID();
       
   SELECT @valueId AS valueId;
   
END ;;
