CREATE DEFINER=`brett`@`%` PROCEDURE `createValue`(
           parentValueId BIGINT,
           ownerId BIGINT ,
           type VARCHAR(10),
           objectIndex BIGINT,
           objectKey TEXT,
           isNull TINYINT,
           stringValue TEXT,
           numericValue DOUBLE,
           boolValue TINYINT
)
exit_procedure: BEGIN

   SET @valueId = NULL,
            @parentValueId = parentValueId,
            @ownerId = ownerId,
            @type = type,
            @objectIndex = objectIndex,
            @objectKey = objectKey,
            @isNull = isNull,
            @stringValue = stringValue,
            @numericValue = numericValue,
            @boolValue = boolValue,
            @insert = NULL;

IF @objectIndex IS NOT NULL THEN
           SELECT  Value.valueId
           INTO       @valueId
           FROM     Value
           WHERE    (@parentValueId IS NULL
                            AND
                            Value.parentValueId IS NULL)
                            OR (Value.parentValueId =
                            @parentValueId)
       AND           Value.objectIndex =    
                            @objectIndex
       FOR UPDATE;
ELSEIF @objectKey IS NOT NULL THEN
       SELECT    Value.valueId,
                           Value.objectIndex
       INTO         @valueId,
                           @objectIndex
       FROM       Value
       WHERE    (@parentValueId IS NULL
                            AND
                            Value.parentValueId IS NULL)
                            OR (Value.parentValueId =
                            @parentValueId)
       AND           Value.objectKey =    
                            @objectKey
       FOR UPDATE;
       
       
       
END IF;
                        
IF @objectIndex IS NULL THEN
    SELECT    MAX(Value.objectIndex)
    INTO         @max
    FROM       Value
    WHERE    (@parentValueId IS NULL
                            AND
                         Value.parentValueId IS NULL)
                         OR (Value.parentValueId =
                            @parentValueId)
    FOR UPDATE;
    
    IF @max IS NULL THEN
        SET @objectIndex = 0;
    ELSE
        SET   @objectIndex = @max + 1;
     END IF;
     
END IF;
                        

IF @valueId IS NULL THEN
   INSERT INTO Value(
           ownerId,
           parentValueId,
           type,
           objectIndex,
           objectKey,
           lowerObjectKey,
           isNull,
           stringValue,
           numericValue,
           boolValue
  )
  VALUES(
           @ownerId,
           @parentValueId,
           @type,
           @objectIndex,
           @objectKey,
           LOWER(@objectKey),
           @isNull,
           @stringValue,
           @numericValue,
           @boolValue
   );
   
   SET @valueId = LAST_INSERT_ID();
   SET @insert = true;
   
ELSE
    UPDATE     Value AS v
    SET               v.ownerId = @ownerId,
                           v.parentValueId = 
                                @parentValueId,
                           v.type = @type,
                           v.objectIndex = @objectIndex,
                           v.objectKey = @objectKey,
                           v.lowerObjectKey =
                              LOWER(@objectKey),
                          v.isNull = @isNull,
                          v.stringValue = @stringValue,
                          v.numericValue =
                             @numericValue,
                          v.boolValue =
                              @v.boolValue
   WHERE      v.valueId = @valueId;
   
   SET @insert = false;
END IF;

   CALL startWords();
  
   CALL createValueWords(
         @objectKey
   );
            
   CALL createValueWords( 
         @stringValue
    );
            
   CALL endWords(@valueId);
             
   # Insert all parents parents
   
   INSERT
   INTO       ValueParentChild(
                              parentValueId,
                              childValueId
                      )
   SELECT   vpc.parentValueId,
                     @valueId
   FROM     ValueParentChild vpc
   WHERE  vpc.childValueId =
                            @parentValueId;
                            
   # Insert this value 
   INSERT
   INTO       ValueParentChild(
                              parentValueId,
                              childValueId
                      )
   SELECT   @valueId,
                      @valueId;
   
   
   SELECT @valueId AS valueId;
   
   
END ;;
