CREATE DEFINER=`brett`@`%` PROCEDURE `insertValue`(
           ownerId BIGINT,
           isSingleValue TINYINT,
           parentValueId BIGINT,
           replaceValueId BIGINT,
           locked TINYINT,
           type VARCHAR(10),
           objectIndex BIGINT,
           objectKey TEXT,
           isNull TINYINT,
           stringValue TEXT,
           numericValue DOUBLE,
           boolValue TINYINT
)
BEGIN

    SET @ownerId = ownerId, 
             @isSingleValue = isSingleValue,
             @parentValueId =  parentValueId,
             @replaceValueId = replaceValueId,
             @locked = locked,
             @type = type,
             @objectIndex = objectIndex,
             @objectKey =  objectKey,
             @isNull =  isNull,
             @stringValue = stringValue,
             @numericValue = numericValue,
             @boolValue = boolValue;
    
    IF @replaceValueId IS NOT NULL AND
            @locked = 1
    THEN
            SELECT
                Value.objectIndex
            INTO
                @objectIndex
            FROM
                Value
            WHERE 
                Value.valueId = @replaceValueId
            FOR UPDATE;
    ELSEIF @objectIndex IS NULL AND
         @objectKey IS NOT NULL
    THEN
        SELECT
            Value.objectIndex
        INTO
            @objectIndex
        FROM
            Value
        WHERE
            Value.parentValueId = @parentValueId
        AND
            Value.objectKey = @objectKey
       # AND
        #    Value.locked = 0
        FOR UPDATE;
    END IF;
    
    IF @objectIndex IS NULL
    THEN
            SELECT
                COUNT(Value.objectIndex) + 1
            INTO
                @objectIndex
            FROM
                Value
            WHERE 
                 Value.parentValueId =
                 @parentValueId
           # AND
             #    Value.locked = 0
            FOR UPDATE;
        

    END IF;
    
    IF @objectIndex IS NULL THEN
        SET @objectIndex = 1;
    END IF;
        
    
    INSERT INTO Value(
           ownerId,
           parentValueId,
           locked,
           type,
           objectIndex,
           objectKey,
           lowerObjectKey,
           isNull,
           stringValue,
           numericValue,
           boolValue
  )
  VALUES(
           @ownerId,
           @parentValueId,
           @locked,
           @type,
           @objectIndex,
           @objectKey,
           LOWER(@objectKey),
           @isNull,
           @stringValue,
           @numericValue,
           @boolValue
   );
  
   SET @valueId = LAST_INSERT_ID();
   
   
   IF (@isSingleValue = 1) THEN 
   
       SET @stagingValueId = @valueId;
       
       CALL insertValueParentChild(
            @replaceValueId,
            @stagingValueId,
            @parentValueId
      );
    /*
       INSERT
       INTO
           ValueParentChild(
               parentValueId,
               childValueId
           )
       SELECT
           parent.parentValueId,
           @valueId as childValueId
       FROM
           ValueParentChild as parent
       WHERE
           parent.childValueId = @parentValueId
       UNION
       SELECT
           @valueId,
           @valueId;
           */
   END IF;
   
   SELECT
       @valueId AS  valueId,
       @objectIndex AS objectIndex;
       
END ;;
