CREATE DEFINER=`brett`@`%` PROCEDURE `insertValueParentChild`(
    replaceValueId BIGINT,
    stagingValueId BIGINT,
    parentValueId BIGINT
)
BEGIN


set @replaceValueId = replaceValueId,
        @stagingValueId = stagingValueId,
        @parentValueId = parentValueId;
       
insert into
    ValueParentChild(
        parentValueId,
        childValueId
    )
with recursive staging (valueId) as
(
   select
       @stagingValueId
   union
   select
       children.valueId
   from
       Value as children
   inner join
       staging
   where
       children.parentValueId =
       staging.valueId
),
parent(
   parentValueId,
   childValueId
) as
(
    
    select
        vpc.parentValueId,
        @stagingValueId
    from
        ValueParentChild as vpc
    where
        vpc.childValueId =
        @parentValueId
        
    union
    
    select
        staging.valueId,
        staging.valueId
    from
        staging
 
    union
    
    select
        parent.parentValueId,
        children.valueId as childValueId
    from
        parent
    inner join
        Value as children
    on
        children.parentValueId =
        parent.childValueId
)

select
    parent.parentValueId,
    parent.childValueId
from
    parent;
    
END ;;
DELIMITER ;
